	public double next() {
		int p= random.nextInt(hist.length-1);
		while (hist[p]<=0 || hist[p+1]==-1) {
			p= random.nextInt(hist.length-1);
		}
		double a=hist[p+1];
		double b=hist[p];
		double v= (a- b) / b;
		last[0]=v;
		return v;
	};
	
	double[] last = new double[100];
	public static int missed;
	
	public double next1(double deltaP) {
		double delta = Math.abs(deltaP*last[0]);
		int p= random.nextInt(hist.length-2);
		double v;
		for (int i = 0; i < hist.length; i++) {
			if (hist[p]>0 && hist[p+1]>0 && hist[p+2]!=-1)  {
				v= (hist[p+1]- hist[p]) / hist[p];
				if (last[0]-delta<=v && v<last[0]+delta) {
					v= (hist[p+2]- hist[p+1]) / hist[p+1];
					last[0]=v;
					return last[0];
				}
			}
			p++;
			if (p>=hist.length-2) p=0;
		}
		missed++;
		return next();
	};
	
	public double next(int order, double deltaP) {
		int p= random.nextInt(hist.length-order-1);
		double v;
		for (int i = 0; i < hist.length; i++) {
			int valid=0;
			for (int j = 0; j < order; j++) {
				if (hist[p+j]>0) valid++;
			}
			if (hist[p+order+1]!=-1)  valid++;
			if (valid==order+1)  {
				valid=0;
				for (int j = 0; j < order; j++) {
					double delta = Math.abs(deltaP*last[j]);
					v= (hist[p+j+1]- hist[p+j]) / hist[p+j];
					if (last[j]-delta<=v && v<last[j]+delta) valid++;
				}
				if (valid==order) {
					v= (hist[p+order+1]- hist[p+order]) / hist[p+order];
					last[0]=v;
					return last[0];
				}
			}
			p++;
			if (p>=hist.length-order-1) p=0;
		}
		missed++;
		System.arraycopy(last, 1, last, 0, last.length-1);
		return next(order-1, deltaP);
	};
	
