	private void add(String name, float[] part, int lastDays) {
		int len1=hist.length;
		int len2=part.length;
		int srcPos=0;
		String info="";
		if (lastDays>0) {
			len2=Math.min(part.length, lastDays);
			srcPos=part.length-len2;
			info="-"+lastDays;
		} else {
			len2=part.length;
		}
		float[] hist2 = new float[len1+len2+1];
		System.arraycopy(hist, 0, hist2, 0, len1);
		System.arraycopy(part, srcPos, hist2, len1, len2);
		hist2[len1+len2]=-1;
		hist=hist2;
		if (desc==null) {
			desc=name+info;
		} else {
			desc=desc+", "+name+info;
		}
	};
	
